import React from 'react';
import { Route, Routes } from 'react-router-dom'; // Import Route and Routes from react-router-dom

import CustomerList from '../components/customerList'; // Import CustomerList component
import NewOrderForm from '../components/newOrderForm'; // Import NewOrderForm component
import OrderList from '../components/orderList'; // Import OrderList component
import NotFound from '../components/notFound'; // Import NotFound component

const labaduhRoutes = () => {
  return (
    <Routes>
      
      <Route path="/order" element={<OrderList />} />
      
    </Routes>
  );
};

export default labaduhRoutes;
